import { useState } from "react";
import Board from "./Board";
import History from "./History";

export const App = () => {
  const [histories, setHistories] = useState([new Array(9).fill(null)]);
  const [currentGameState, setCurrentGameState] = useState(histories[0]);
  return (
    <div className="game">
      <Board currentGameState={currentGameState} />
      <History
        histories={histories}
        onSelectHistory={(gameState) => {
          setCurrentGameState([...gameState]);
        }}
      />
    </div>
  );
};

export default App;
